    false,nt"url": null,nt"notes": "Reson 8101ER multibeam Data were collected
    on April 24, 2015 aboard NOAA Survey Launch Acoustic Habitat Investigator (AHI)
    in the Main Hawaiian Islands at Oahu during cruise AHI1502. These multibeam data
    were collected using SAIC ISS-2000 v 4.0.0.3.0 software in the Generic Sensor Format
    and processed using SABER editing software. Sound velocity corrections from a Seabird
    SBE19 CTD sensor and motion corrections from a POS-MV vertical reference were applied
    to the data in real time. Observed tides were applied during processing. Horizontal
    accuracy is ~5m (differential GPS correctors applied), vertical accuracy is depth
    dependent (~1% of water depth), WGS84 datum. These data are not to be used for navigation.
    Depths mapped range from ~ 3 - 20 m. The AHI was deployed from shore.",nt"license_title":
